import React from 'react';
import './NavBar.css';

function NavBar() {
  return (
    <div className="search-form">
    	<nav class="navbar navbar-dark bg-dark">
  			<a class="navbar-brand logo" href="#">FindMovies</a>
		</nav>
    </div>
  );
}

export default NavBar;
